import React from "react";
class Hari extends React.Component{
    constructor(){
        super();
        this.state={
            name:"Hari",
            city:"bangalore",
            role:"React",

        }
    }

handleHari=()=>{
    this.setstate({
        name:"hari",
        city:"tirupati",
        role:"react",
    })
}

render(){
    return(
        <div>
            {this.state.name}<br/>
            {this.state.city}<br/>
            {this.state.role}<br/>
            <button onClick={this.handleHari}>ADD</button>

        
        </div>
    )
}
}
export default Hari;
